import styles from './style.module.css';

const ResponsivePage = () => {
  return (
    <div className={styles.container}>
      <header className={styles.header}>
        <h1>Responsive Layout Example</h1>
        <p>
          This layout adapts to different screen sizes using CSS media queries.
        </p>
      </header>
      <main className={styles.mainContent}>
        <section className={styles.sidebar}>Sidebar</section>
        <section className={styles.content}>Main Content</section>
        <section className={styles.extra}>Extra</section>
      </main>
      <footer className={styles.footer}>Footer</footer>
    </div>
  );
};

export default ResponsivePage;
